import {makeStyles} from "@mui/material";

const useStyles = makeStyles({
    img: {
        width: 75,
        height: 75,
        borderRadius: "50%",
        objectFit: "cover",
        
    },
    mainContainer: {
        display: "flex",
        flexDirection: "column",
        backgroundColor: "#cfe8fc",
        height: "95vh",
        width: "95vw",
        justifyContent: "center",
        alignItems: "center",
    },
    card: {},
    cardHeader: {},
    cardContent: {},

});

export default useStyles;
